    <p>{`The Vector `}<inlineCode parentName="p">{`dedupe`}</inlineCode>{` transform
accepts and outputs `}<a parentName="p" {...{
        "href": "/docs/about/data-model/log/"
      }}><inlineCode parentName="a">{`log`}</inlineCode></a>{` events, allowing you to
prevent duplicate Events from being outputted by using an LRU cache.`}</p>
    {
      /*
          THIS FILE IS AUTOGENERATED!
           To make changes please edit the template located at:
           website/docs/reference/transforms/dedupe.md.erb
      */
    }
    <h2 {...{
      "id": "configuration"
    }}>{`Configuration`}</h2>
    <Tabs block={true} defaultValue="common" values={[{
      "label": "Common",
      "value": "common"
    }, {
      "label": "Advanced",
      "value": "advanced"
    }]} mdxType="Tabs">
      <TabItem value="common" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.my_transform_id]
  # General
  type = "dedupe" # required
  inputs = ["my-source-or-transform-id"] # required

  # Fields
  fields.match = ["timestamp", "host", "message"] # optional, default
`}</code></pre>
      </TabItem>
      <TabItem value="advanced" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.my_transform_id]
  # General
  type = "dedupe" # required
  inputs = ["my-source-or-transform-id"] # required

  # Cache
  cache.num_events = 5000 # optional, default

  # Fields
  fields.ignore = ["field1", "parent.child_field"] # optional, no default
  fields.match = ["timestamp", "host", "message"] # optional, default
`}</code></pre>
      </TabItem>
    </Tabs>
    <Fields filters={true} mdxType="Fields">
      <Field common={false} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"cache"} path={null} relevantWhen={null} required={false} templateable={false} type={"table"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "cache"
        }}>{`cache`}</h3>
        <p>{`Options controlling how we cache recent Events for future duplicate checking.`}</p>
        <Fields filters={false} mdxType="Fields">
          <Field common={true} defaultValue={5000} enumValues={null} examples={[5000]} groups={[]} name={"num_events"} path={"cache"} relevantWhen={null} required={false} templateable={false} type={"uint"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "num_events"
            }}>{`num_events`}</h4>
            <p>{`The number of recent Events to cache and compare new incoming Events against.`}</p>
          </Field>
        </Fields>
      </Field>
      <Field common={true} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"fields"} path={null} relevantWhen={null} required={true} templateable={false} type={"table"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "fields"
        }}>{`fields`}</h3>
        <p>{`Options controlling what fields to match against`}</p>
        <Fields filters={false} mdxType="Fields">
          <Field common={false} defaultValue={null} enumValues={null} examples={[["field1", "parent.child_field"]]} groups={[]} name={"ignore"} path={"fields"} relevantWhen={null} required={false} templateable={false} type={"[string]"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "ignore"
            }}>{`ignore`}</h4>
            <p>{`The field names to ignore when deciding if an Event is a duplicate.
Incompatible with the `}<inlineCode parentName="p">{`fields.match`}</inlineCode>{` option.`}</p>
          </Field>
          <Field common={true} defaultValue={["timestamp", "host", "message"]} enumValues={null} examples={[["field1", "parent.child_field"]]} groups={[]} name={"match"} path={"fields"} relevantWhen={null} required={false} templateable={false} type={"[string]"} unit={null} warnings={[]} mdxType="Field">
            <h4 {...{
              "id": "match"
            }}>{`match`}</h4>
            <p>{`The field names considered when deciding if an Event is a duplicate. This can
also be globally set via the `}<a parentName="p" {...{
                "href": "/docs/reference/global-options/#log_schema"
              }}>{`global `}<inlineCode parentName="a">{`log_schema`}</inlineCode>{`
options`}</a>{`.Incompatible with the
`}<inlineCode parentName="p">{`fields.ignore`}</inlineCode>{` option.`}</p>
          </Field>
        </Fields>
      </Field>
    </Fields>
    <h2 {...{
      "id": "how-it-works"
    }}>{`How It Works`}</h2>
    <h3 {...{
      "id": "cache-behavior"
    }}>{`Cache Behavior`}</h3>
    <p>{`This transform is backed by an LRU cache of size `}<inlineCode parentName="p">{`cache.num_events`}</inlineCode>{`.
That means that this transform will cache information in memory for the last
`}<inlineCode parentName="p">{`cache.num_events`}</inlineCode>{` Events that it has processed.  Entries will be removed from
the cache in the order they were inserted.  If an Event is received that is
considered a duplicate of an Event already in the cache that will put that event
back to the head of the cache and reset its place in line, making it once again
last entry in line to be evicted.`}</p>
    <h3 {...{
      "id": "complex-processing"
    }}>{`Complex Processing`}</h3>
    <p>{`If you encounter limitations with the `}<inlineCode parentName="p">{`dedupe`}</inlineCode>{`
transform then we recommend using a `}<a parentName="p" {...{
        "href": "https://vector.dev/components/?functions%5B%5D=program"
      }}>{`runtime transform`}</a>{`.
These transforms are designed for complex processing and give you the power of
full programming runtime.`}</p>
    <h3 {...{
      "id": "environment-variables"
    }}>{`Environment Variables`}</h3>
    <p>{`Environment variables are supported through all of Vector's configuration.
Simply add `}<inlineCode parentName="p">{`\${MY_ENV_VAR}`}</inlineCode>{` in your Vector configuration file and the variable
will be replaced before being evaluated.`}</p>
    <p>{`You can learn more in the
`}<a parentName="p" {...{
        "href": "/docs/setup/configuration/#environment-variables"
      }}>{`Environment Variables`}</a>{` section.`}</p>
    <h3 {...{
      "id": "memory-usage-details"
    }}>{`Memory Usage Details`}</h3>
    <p>{`Each entry in the cache corresponds to an incoming Event and contains a copy of
the 'value' data for all fields in the Event being considered for matching.
When using `}<inlineCode parentName="p">{`fields.match`}</inlineCode>{` this will be the list of fields specified in that
config option. When using `}<inlineCode parentName="p">{`fields.ignore`}</inlineCode>{` that will include all fields present
in the incoming event `}<em parentName="p">{`except`}</em>{` those specified in `}<inlineCode parentName="p">{`fields.ignore`}</inlineCode>{`. Each entry
also uses a single byte per field to store the type information of that field.
When using `}<inlineCode parentName="p">{`fields.ignore`}</inlineCode>{` each cache entry additionally stores a copy of each
field name being considered for matching.  When using `}<inlineCode parentName="p">{`fields.match`}</inlineCode>{` storing
the field names is not necessary.`}</p>
    <h3 {...{
      "id": "memory-utilization-estimation"
    }}>{`Memory Utilization Estimation`}</h3>
    <p>{`If you want to estimate the memory requirements of this transform
for your dataset, you can do so with these formulas:`}</p>
    <p>{`When using `}<inlineCode parentName="p">{`fields.match`}</inlineCode>{`:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-text"
      }}>{`Sum(the average size of the *data* (but not including the field name) for each field in \`fields.match\`) * \`cache.num_events\`
`}</code></pre>
    <p>{`When using `}<inlineCode parentName="p">{`fields.ignore`}</inlineCode>{`:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-text"
      }}>{`(Sum(the average size of each incoming Event) - (the average size of the field name *and* value for each field in \`fields.ignore\`)) * \`cache.num_events\`
`}</code></pre>
    <h3 {...{
      "id": "missing-fields"
    }}>{`Missing Fields`}</h3>
    <p>{`Fields with explicit null values will always be considered different than if
that field was omitted entirely.  For example, if you run this transform with
`}<inlineCode parentName="p">{`fields.match = ["a"]`}</inlineCode>{`, the event "{a: null, b:5}" will be considered different
than the event "{b:5}".`}</p>
    </MDXLayout>;
}

